		/* This class contains the code of the Thread that reads a line from the source file, processes a line and writes the output to the Target */
		class OdiFileTransformer extends Thread {
			OdiStringUtils myStringUtils= new OdiStringUtils();
			BufferedWriter myBufferedWriter;
			<?
				 createOutputFormaters();
			?>
			String trgRecordSeparator;
			String trgLineSeparator;
			StringBuilder myStringBuilder;
			boolean doWeContinueBatch;
			static final String connectionDriver = "<%= odiRef.getInfo("SRC_JAVA_DRIVER") %>";
			static final String connectionURL = "<%= odiRef.getInfo("SRC_JAVA_URL") %>";
			static final String connectionUser = "<%= odiRef.getInfo("SRC_USER_NAME") %>";
			static final String connectionPassword = "<%= odiRef.getInfo("SRC_PASS") %>";
			String myQuery;
			double minValue;
			double maxValue;
			Connection myConnection;

			public void setConnection(Connection pConnection){
				myConnection = pConnection;
			}

			public OdiFileTransformer(BufferedWriter pBufferedWriter, String pQuery, double pMinValue, double pMaxValue){
				super();
				myBufferedWriter = pBufferedWriter;
				this.setName("OdiFileTransformer");
				trgRecordSeparator = "<%= odiRef.getTargetTable("SFILE_SEP_FIELD") %>";
				trgLineSeparator = "<%= odiRef.getTargetTable("SFILE_SEP_ROW") %>";
				myStringBuilder = new StringBuilder();
				doWeContinueBatch = true;
				minValue = pMinValue;
				maxValue = pMaxValue;
				myQuery = pQuery;
				myConnection = null;
			}

			public OdiFileTransformer(BufferedWriter pBufferedWriter, String pQuery, double pMinValue, double pMaxValue, Connection pConnection){
				this(pBufferedWriter, pQuery, pMinValue, pMaxValue);
				setConnection(pConnection);
			}

			public void run() {
			try {
				if (myConnection == null) {
					try {
						Class driverClass = Class.forName(connectionDriver);
						Properties myProperties = new Properties();
						myProperties.setProperty("user", connectionUser);
						myProperties.setProperty("password", connectionPassword);
						setConnection(((Driver)driverClass.newInstance()).connect(connectionURL, myProperties));
					}
					catch (Exception e) {
						throw(new RuntimeException(e.getMessage()));
					}
				}
				String realQuery = null;
				if ((minValue==0)&& (maxValue==0)) {
					realQuery = myQuery; 
				} else {
					realQuery = "select * from (" + myQuery + ") where <%= odiRef.getOption("PARTITION_COL_NAME") %> >= ? and <%= odiRef.getOption("PARTITION_COL_NAME") %> < ? ";
				}
				PreparedStatement myPreparedStatement = myConnection.prepareStatement(realQuery);
				if (!((minValue==0)&& (maxValue==0))) {
					myPreparedStatement.setDouble(1, minValue);
					myPreparedStatement.setDouble(2, maxValue);
				}

				ResultSet myResultset = myPreparedStatement.executeQuery();
				myResultset.setFetchSize(50);
				while (myResultset.next()){
					/* We start the processing of the line by clearing the StringBuilder */
					myStringBuilder.setLength(0);
					<? useOutputFormaters(); ?>

					myStringBuilder.append(trgLineSeparator);
					myBufferedWriter.write(myStringBuilder.toString());
				}
			}
			catch (Exception e) {
				throw(new RuntimeException(e.getMessage()));
			}
			}
		}

		/* The beginning of the main code is here*/
		/* We open the target File by taking the encoder into account if needed */
		<% if (odiRef.getOption("TARGET_ENCODING").trim().length() == 0) { %>
			BufferedWriter myBufferedWriter = new BufferedWriter(new FileWriter("<%= odiRef.getTable("TARG_NAME") %>", <% if (odiRef.getOption("APPEND").equals("1")) { %>true<% } else { %>false<% } %>));
		<% } else { %>
			BufferedWriter myBufferedWriter = new BufferedWriter(new OutputStreamWriter(new FileOutputStream("<%= odiRef.getTable("TARG_NAME") %>", <% if (odiRef.getOption("APPEND").equals("1")) { %>true<% } else { %>false<% } %>), "<%= odiRef.getOption("TARGET_ENCODING").trim() %>"));
		<% } %>


		String connectionDriver = "<%= odiRef.getInfo("SRC_JAVA_DRIVER") %>";
		String connectionURL = "<%= odiRef.getInfo("SRC_JAVA_URL") %>";
		String connectionUser = "<%= odiRef.getInfo("SRC_USER_NAME") %>";
		String connectionPassword = "<%= odiRef.getInfo("SRC_PASS") %>";

		Class driverClass = Class.forName(connectionDriver);
		Properties myProperties = new Properties();
		myProperties.setProperty("user", connectionUser);
		myProperties.setProperty("password", connectionPassword);
		Connection myConnection = ((Driver)driverClass.newInstance()).connect(connectionURL, myProperties);

		double minPartitionValue = 0;
		double maxPartitionValue = 0;
		double partitionIncrement = 0;

		if (NB_THREADS > 1) {
			PreparedStatement myPreparedStatement = myConnection.prepareStatement("select min(<%= odiRef.getOption("PARTITION_COL_NAME") %>), max(<%= odiRef.getOption("PARTITION_COL_NAME") %>) from (" + getQuery() + ")");
			ResultSet myResultset = myPreparedStatement.executeQuery();
			myResultset.next();

			minPartitionValue= myResultset.getDouble(1);
			maxPartitionValue= myResultset.getDouble(2);

			myResultset.close();
			myPreparedStatement.close();
			partitionIncrement = (maxPartitionValue+1-minPartitionValue)/NB_THREADS;
		}

		OdiFileTransformer[] odiFileTransformers = new OdiFileTransformer[NB_THREADS];
		odiFileTransformers[0] = new OdiFileTransformer(myBufferedWriter, getQuery(), minPartitionValue, minPartitionValue+partitionIncrement, myConnection);
		for (int i=1;i<NB_THREADS;i++){
			minPartitionValue = minPartitionValue + partitionIncrement;
			odiFileTransformers[i] = new OdiFileTransformer(myBufferedWriter, getQuery(), minPartitionValue, minPartitionValue+partitionIncrement);
		}

		for (int i=0;i<NB_THREADS;i++){
			odiFileTransformers[i].start();
		}

		for (int i=0;i<NB_THREADS;i++){
			odiFileTransformers[i].join();
		}

		/* We flush the buffer for any data that has not been written on the disk yet */
		myBufferedWriter.flush();
	}
